import './form.css';

export default function Form(props) {
    return(
        <div className='form-container'>
            <form>
                <label>Email: </label>
                <input
                type='text'
                name='email'
                //value={userData.Email}
                //onChange={handleChange}
                />

                <label>Pasword: </label>
                <input 
                     type='text'
                     name='password'
                     //value={userData.Email}
                     //onChange={handleChange}
                     />

                <button type='submit'></button>
            </form>

        </div>
    )
}
